import './App.css';

function App() {
  return (
    <div>
        <Header />
        <Tech />
    </div>
  );
}

function Header() {
    return (
        <div className="first">
            <a href="#">Home</a>
            <a href="#">News</a>
            <a href="#">Contacts</a>
        </div>
    );
}

export default App;
